import './App.css';

const Numbers = (props) => {
  return (
    <>
    <h3>{props.first} {props.operator} {props.second} = </h3>
    </>
  )
}


const App = () => {

  var f;
  var s;
  const newEq = true;
  if (newEq) {
    opNum = Math.random() * 4
    if (opNum == 0) {
      f = Math.random() * 99 + 2
      s = Math.random() * 99 + 2
    }
  }

  return (
    <div className="App">
      <div className='rectangle'>
        <Numbers first={10} operator={"-"} second={2}></Numbers>
      </div>
    </div>
  );
}

export default App;
